import React from "react";
import {
  Button,
  Card,
  Form,
  FormLayout,
  Layout,
  Page,
  Stack,
  TextField,
  TextStyle,
  EmptyState
} from '@shopify/polaris';
import '@shopify/polaris/styles.css';

function Header() {
  return (
    <Card>
    <div>
  <div.Brand href="#home">Navbar with text</div.Brand>
  <div.Toggle />
  <div.Collapse className="justify-content-end">
    <div.Text>
      Signed in as: <a href="#login">Mark Otto</a>
    </div.Text>
  </div.Collapse>
</div>
    </Card>
  );
}
export default Header;
